	void testFiboBinet(long a, long expected) {
		long actual = Fibonacci.fiboBinet(a);
		String temp_ = new String();
		temp_ = (expected == actual) ? "True" : "False";
		
		System.out.printf("Fibonacci %d , expected = %d, actual = %d %s\n", a, expected, actual, temp_);
		assertEquals(expected, actual);
	}

